import React from 'react';
import { Link } from "react-router-dom";

function PostCard(props) {
    return (
        <Link to="/posts/${props.key}">
            <div>
                <h3>This is the Card</h3>
                <p>{props.info.title}</p>
            </div>
        </Link>
    )
}

export default PostCard
